import {createAction} from '@reduxjs/toolkit'
import {AuthTypes} from "../reducers/authReducer"


export const authActions = {
    fetchTokenBegin: createAction<AuthTypes>('token/beginFetch'),
    fetchTokenSuccess: createAction<AuthTypes>('token/fetchSuccess'),
    fetchTokenFailure: createAction<AuthTypes>('token/fetchFailure')
};
